import React from 'react';
import './App.css';
import SideMenu from "../components/SideMenu";
import { makeStyles, CssBaseline, createTheme, ThemeProvider } from '@material-ui/core';
import Header from "../components/Header";
import {Switch, Route, BrowserRouter} from "react-router-dom";

import Associations from "../pages/Associations/Associations";
import AssociationDisable from '../pages/Associations/AssociationDisable';
import Admins from '../pages/Associations/Admins/Admins';
import AdminDisable from '../pages/Associations/Admins/AdminDisable';
import Membres from '../pages/Associations/membres/Membres';
import MembreDisable from '../pages/Associations/membres/MembreDisable';

const theme = createTheme({
  palette: {
    primary: {
      main: "#f4661b",
      light: '#FFE5DA'
    },
    secondary: {
      main: "#f83245",
      light: '#f8324526'
    },
    background: {
      default: "#f4f5fd"
    },
  },
  overrides:{
    MuiAppBar:{
      root:{
        transform:'translateZ(0)'
      }
    }
  },
  props:{
    MuiIconButton:{
      disableRipple:true
    }
  }
})


const useStyles = makeStyles({
  appMain: {
    paddingLeft: '250px',
    width: '100%'
  }
})

function App() {
  const classes = useStyles();

  return (
    <BrowserRouter>
      <Switch>
            <Route path="/associacoes" exact component={ Associations } />
            <Route path="/associacoes_desativar" exact component={ AssociationDisable } />
            <Route path="/administradores" exact component={ Admins } />
            <Route path="/administradores_desativar" exact component={ AdminDisable } />
            <Route path="/membros" exact component={ Membres } />
            <Route path="/membros_desativar" exact component={ MembreDisable } />
          </Switch>
      <ThemeProvider theme={theme}>
        <SideMenu />
        <div className={classes.appMain}>
          <Header />
        </div>
        <CssBaseline />
      </ThemeProvider>
    </BrowserRouter>
  );
}

export default App;
